import React from 'react';
import '../../src/App.css'
import '../../src/index.css'

function ContactUs() {
    return (
        <div className="ibnmajah-container">
            <h2>Contact Us</h2>
            <p>Welcome to Deen Khaalis Academy! We are dedicated to providing teachings to the Muslim community</p>
            <p>Our main focus is to convay the message of Allah and that of the Prophet
                peace be upon him in a way that it was understood by the Prophet's companions.</p>
            <p>At Deen Khaalis Academy, we offer a wide range of programs</p>
            <p>Contact us today to learn more about our academy and how we can help you achieve your educational goals.</p>
        </div>
    );
}

export default ContactUs;
